import classes from './Experience.module.css';
import Carossel from './Carossel';
// import image from '../../src/Assets/Rectangle 1.png';

const Experience = () => {

  // const data = [{title: 'ola', texto: 'sdakldnksadsklsad'}, {title: 'ola', texto: 'sdakldnksadsklsad'}, {title: 'ola', texto: 'sdakldnksadsklsad'}];
